import org.apache.nifi.processor.io.StreamCallback
import org.apache.commons.io.IOUtils
import java.nio.charset.*

def flowFile = session.get()
if(!flowFile) return

flowFile = session.write(flowFile, {inputStream, outputStream ->
    String specialCharRegex = /\{\"id\":(.*?)]}/;
    def ffcontent = IOUtils.toString(inputStream, StandardCharsets.UTF_8); 
    def attr = flowFile.getAttribute("id-data-content");
	String backslashCharRegex = /(?<!\\)\\(?!\\)/;
    def attrModified = attr.replaceAll(backslashCharRegex, "\\\\\\\\\\\\\\\\");
    def modified = ffcontent.replaceFirst(specialCharRegex, '{"replaced":' + attrModified + ']}');
    outputStream.write(modified.getBytes(StandardCharsets.UTF_8));
} as StreamCallback)

session.transfer(flowFile, REL_SUCCESS)

