    String specialCharRegex = /\{\"replaced\"\:\[(.*?)\]}/;
    def ffcontent = IOUtils.toString(inputStream, StandardCharsets.UTF_8); 
    def match = ffcontent =~ specialCharRegex;
	//def match1 = match[0][0];
